import React from "react";
import SData from "./SData";
import Cards from "./Cards";

const Amazon=()=>{
    return ( 
        <Cards
          key={SData[5].id}
          imgsrc={SData[5].imgsrc}
          title={SData[5].title}
          sname={SData[5].sname}
          links={SData[5].links}
        />);
    }

export default Amazon;
